import React, { useState } from 'react';
import { FaInstagram, FaLinkedin, FaFacebook } from 'react-icons/fa';
import './Footer.css'; // Muista päivittää polku tarvittaessa

const Footer = () => {
    const [instagram, setInstagram] = useState('instagram-Kasaan Oy');
    const [linkedin, setLinkedin] = useState('linkedin-tili');
    const [facebook, setFacebook] = useState('facebook-tili');

    return (
        <footer className="footer">
            <div className="footer-icons">
                <span className="footer-text-label">somet</span>
                <div className="footer-icon-text">
                    <a
                        href={`https://www.instagram.com/kasaanoy/${instagram}`}
                        target="_blank"
                        rel="noopener noreferrer">
                        <FaInstagram size={30} />
                    </a>
                    <span className="footer-caption">{instagram}</span>
                </div>
                <div className="footer-icon-text">
                    <a
                        href={`https://www.linkedin.com/company/kasaan-oy/posts/?feedView=all${linkedin}`}
                        target="_blank"
                        rel="noopener noreferrer">
                        <FaLinkedin size={30} />
                    </a>
                    <span className="footer-caption">{linkedin}</span>
                </div>
                <div className="footer-icon-text">
                    <a
                        href={`https://www.facebook.com/profile.php?id=61568924945460${facebook}`}
                        target="_blank"
                        rel="noopener noreferrer">
                        <FaFacebook size={30} />
                    </a>
                    <span className="footer-caption">{facebook}</span>
                </div>
            </div>
            <div className="footer-text">
                <p className="footer-email">info@kasaan.fi</p>
            </div>
        </footer>
    );
};

export default Footer;
